import React from "react";
import "./App.css";

function NavBar() {
  return (
    <nav>
      <ul>
        <li>Home</li>
        <li>Products</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}

function ToDo() {
  const [newToDo, setNewToDo] = React.useState("");
}

function Profile(props) {
  console.log(props);
  return (
    <div>
      <h2>{props.name}</h2>
      <p>{props.info}</p>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <NavBar />
      <Profile name="Ludvig" info="people pleaser"/>
      <Profile name="Sigrid" info="manipulator"/>
    </div>
  );
}

export default App;
